import React from 'react';
import { Layout, Menu, Breadcrumb } from 'antd';
import { Card } from 'antd';
import './App.css';
import { UserOutlined, LaptopOutlined, NotificationOutlined } from '@ant-design/icons';
const { SubMenu } = Menu;

const { Header, Content, Footer, Sider } = Layout;
const cardData = [
  {
    nama : "Fadpus",
    job : "Athlete"
  },
  {
    nama : "Puspa",
    job : "Singer"
  },
  {
    nama : "Fadhilah",
    job : "Guitarist"
  },
  {
    nama : "Puspasari",
    job : "Song Writer"
  },
  {
    nama : "Fadhilah Puspasari",
    job : "Sleeping"
  }
]

function App() {
  return (
    <Layout>
    <Header className="header">
      <div className="logo" />
      <Menu
        theme="dark"
        mode="horizontal"
        defaultSelectedKeys={['2']}
        style={{ lineHeight: '64px' }}
      >
        <Menu.Item key="1">Home</Menu.Item>
        <Menu.Item key="2">About</Menu.Item>
        <Menu.Item key="3">Contact</Menu.Item>
      </Menu>
    </Header>
    <Layout>
      <Sider width={200} className="site-layout-background">
        <Menu
          mode="inline"
          defaultSelectedKeys={['1']}
          defaultOpenKeys={['sub1']}
          style={{ height: '100%', borderRight: 0 }}
        >
          <SubMenu
            key="sub1"
            title={
              <span>
                <UserOutlined />
                Profile
              </span>
            }
          >
            <Menu.Item key="1">Hobbies</Menu.Item>
            <Menu.Item key="2">Partners</Menu.Item>
            <Menu.Item key="3">Family</Menu.Item>
            <Menu.Item key="4">House</Menu.Item>
          </SubMenu>
          <SubMenu
            key="sub2"
            title={
              <span>
                <LaptopOutlined />
                Videos
              </span>
            }
          >
            <Menu.Item key="5">Cover Song</Menu.Item>
            <Menu.Item key="6">Animals</Menu.Item>
            <Menu.Item key="7">Guitar</Menu.Item>
            <Menu.Item key="8">Sports</Menu.Item>
          </SubMenu>
          <SubMenu
            key="sub3"
            title={
              <span>
                <NotificationOutlined />
                Notifications
              </span>
            }
          >
            <Menu.Item key="9">Work</Menu.Item>
            <Menu.Item key="10">Healthy</Menu.Item>
            <Menu.Item key="11">option11</Menu.Item>
            <Menu.Item key="12">option12</Menu.Item>
          </SubMenu>
        </Menu>
      </Sider>
      <Layout style={{ padding: '0 24px 24px' }}>
        <Breadcrumb style={{ margin: '16px 0' }}>
          <Breadcrumb.Item>Home</Breadcrumb.Item>
          <Breadcrumb.Item>About</Breadcrumb.Item>
          <Breadcrumb.Item>Contact</Breadcrumb.Item>
        </Breadcrumb>
        <div className="App">
      {
        cardData.map( data =>
          <Card title={data.nama} bordered={true} style={{ margin:10,display:'inline-block', width: 300 }}>
            <p>{data.job}</p>
          </Card>
      )
    }
    </div>
        <Content
          className="site-layout-background"
          style={{
            padding: 24,
            margin: 0,
            minHeight: 280,
          }}
        >
        </Content>
        <Footer style={{ textAlign: 'center' }}>FP Â©2018 Created by Fadhilah PUspasari</Footer>
      </Layout>
    </Layout>
  </Layout>

  );
}

export default App;
